package loopingTest;

/**
 * for loop to print * in 5 rows & 5 columns
 */
public class ForTest4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i = 0; i < 5; i++) {
			for (int j = 0; j < 5; j++) {
				System.out.print("* ");
			}
			System.out.println();
		}
	}

}
